package com.kita.first;

public class Break {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int i=0; i<10; i++) {
			for(int j=0; j<3;j++) {
				if(i==3) {
					break;
				
				}
				System.out.printf("%d - %d \n",i,j);
			}
		
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
			
		}
	}

}
